import axios from 'axios';
import React from 'react';

const Users = () => {
    React.useEffect(() => {
        axios.get("/api/users")
        .then(users => console.log(users))
    })
    return(
        <>
        <h1>Users</h1>
        </>
    )
}

export default Users;
